INSERT INTO `about_freshmor` (`id`, `description`, `created_at`, `updated_at`) VALUES
(1,	'Vensemart is a bespoke user friendly vendor and service providers solution, designed to easily connect tested, trusted, verified and certified professional service providers (freelancers, sme’s and corporate companies) to daily personal, home and corporate service needs, from personal grooming (barbing/hairdo, makeup, massage and dressing), electrical repairs, mechanical repairs, to general building construction and repairs. It is a guaranteed marketplace for personal, home and office daily consumptions shopping and a reliable logistic service delivery solution.\r\n\r\nIt’s a one-stop spot that guarantees affordable, effective, efficient, safe and timely service delivery and products that takes the hassle of transporting home service needs to service outlets, inconveniences to cue at shopping mall and disappointment by logistics delivery agencies, and translates value for money.\r\n\r\nIt enables the end users to access closest and reliable services within 3 minutes of location proximity, book and manage appointments at convenience and avoid queuing at public outlet for service needs with a relaxed and first class user experience.',	'2022-03-07 17:25:48',	'2022-03-07 17:25:48')
